import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import KitchenBox from '../component/KitchenBox';
import './kitchen.css';
import Cards from '../component/Cards';
import Masonry, { ResponsiveMasonry } from 'react-responsive-masonry';
import Container from 'react-bootstrap/esm/Container';
import Navbar from '../navSection/Navbar';
import SearchBar from '../component/SearchBar';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import ListGroup from 'react-bootstrap/ListGroup';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';

const carouselData = [
  {
    imgs: [
      'https://www.plotprojects.com/wp-content/uploads/2023/05/rsz_best_delivery_management_software.jpg',
    ],
    name: 'jollof rice',
    price: 4550,
    desc: 'The best nigeria jollof rice',
  },
  {
    imgs: [
      'https://img.freepik.com/premium-vector/online-parcel-delivery-service-concept-mobile-app-concept-hand-holding-phone-with-parcel-delivery-application-display-courier-carries-cart-with-boxes-orders-truckflat-illustration_608021-195.jpg?w=360',
    ],
    name: 'okro and panded yam',
    price: 7530,
    desc: 'okro and pando combo',
  },
];

function Kitchen() {
  const location = useLocation();
  return (
    <div>
      <Navbar />
      <SearchBar />

      <div className="my-">
        <Container>
          <Row>
            <Col>
              <div className="">
                <ListGroup variant="flush">
                  <ListGroup.Item className="">
                    <div className="search-results1 p-3">
                      <div className="d-flex align-items-center gap-1 ">
                        <strong className="text-capitalize border-bottom text-secondary">
                          {carouselData[0].name}
                        </strong>
                        <img
                          src="https://cdn-icons-png.freepik.com/512/7641/7641727.png"
                          alt=""
                          style={{ width: '20px' }}
                        />
                      </div>
                      <span className="">
                        All products here belongs to {carouselData[0].name}{' '}
                        stores
                      </span>
                    </div>
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <div>
                      <strong>Sort by:</strong>
                      <div className="search-results1">
                        <Form>
                          <InputGroup>
                            <InputGroup.Text className='d-flex gap-1'>
                              All <Form.Check className='border'/>
                            </InputGroup.Text>
                          </InputGroup>
                          <InputGroup>
                            <InputGroup.Text className='d-flex gap-1'>
                              SeaFoods <Form.Check className='border'/>
                            </InputGroup.Text>
                          </InputGroup>
                          <InputGroup>
                            <InputGroup.Text className='d-flex gap-1'>
                            Desserts <Form.Check className='border'/>
                            </InputGroup.Text>
                          </InputGroup>
                          <InputGroup>
                            <InputGroup.Text className='d-flex gap-1'>
                            Beverages <Form.Check className='border'/>
                            </InputGroup.Text>
                          </InputGroup>
                        </Form>
                      </div>
                    </div>
                  </ListGroup.Item>
                </ListGroup>
              </div>
            </Col>
            <Col></Col>
          </Row>
          <ResponsiveMasonry
            columnsCountBreakPoints={{ 350: 2, 750: 4, 900: 5 }}
          >
            <Masonry gutter="10px">
              {carouselData.map((item) => (
                <Link
                  style={{ maxHeight: '270px', minHeight: '270px' }}
                  className="text-decoration-none "
                  key={item._id}
                >
                  <Cards item={item} />
                </Link>
              ))}
            </Masonry>
          </ResponsiveMasonry>
        </Container>
      </div>
    </div>
  );
}

export default Kitchen;
